@IAPonomarenko #SlavaAmerica for #SlavaUkrainii 

Just now in Australia 11 November at 11am we all went quiet, 1 minute silence for WW1,WW2, Vietnam War, Korean War remembrance for defenders from tyrants &amp; evil. 

First time in my life I felt so emotional because all I think about is #Ukraine!

@2lshBNDhLjtUypU @DefenceU The total value of our aid packages to Ukraine is around $19 Billion USD. 
We spent $20.2 Billion USD on air conditioning in Afghanistan every year. 
We were in Afghanistan for 20 years.
